import {Router } from 'react-router-dom';
import Routes from './components/Route';
import History from './components/History';
function App() {
  document.title="BLOGSPOT"
  return (

    <Router history={History}>
    <div className="App">


        <Box style={{marginTop:'64px'}}>
        {Routes}
        </Box>


    </div>
    </Router>  

  );
}

export default App;
